import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Electronics" category card (home page grid)
    // Try by text inside .category-card first
    const electronicsCard = await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_card_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_card_visible.png'));

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the category results heading to appear
    await page.waitForSelector('h2', { timeout: 5000 });
    // Confirm we are in Electronics by checking the heading text
    const headingHandles = await page.$$('h2');
    let electronicsHeading = null;
    for (const h of headingHandles) {
      const text = await h.textContent();
      if (text && text.toLowerCase().includes('electronics')) {
        electronicsHeading = h;
        break;
      }
    }

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Extract product titles in the Electronics category
    // Wait for at least one product card to appear
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productTitles = await page.$$eval('.product-card .product-title', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Navigated to Electronics category and extracted product titles",
      extractedData: {
        heading: electronicsHeading ? (await electronicsHeading.textContent()).trim() : null,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
